import React from 'react';


function Video() {
  return (
   <section className="video-test-section">
   	<div className="row">
   		<div className="col-md-4 video-item">Video 1</div>
   		<div className="col-md-4 video-item">Video 2</div>
   		<div className="col-md-4 video-item">Video 3</div>
   	</div>
   </section>
  );
}

export default Video;
